INSERT INTO `ev_articles` VALUES (1,'如何学习JS','<h2>JavaScript 是脚本语言</h2>\r\n<p>JavaScript 是一种轻量级的编程语言。</p>\r\n<p>JavaScript 是可插入 HTML 页面的编程代码。</p>\r\n<p>JavaScript 插入 HTML 页面后，可由所有的现代浏览器执行。</p>\r\n<p>JavaScript 很容易学习。</p>','\\uploads\\42dacc209a253a7b2c65679ccb3ad926','2023-04-17 17:45:18.826','已发布',0,3,9),(2,'兵马俑','<p data-pid=\"eHQ-fKZd\">1974年</p>','\\uploads\\fbff3ffc2d115c6df3cb9ea50c10ea17','2023-04-17 18:53:38.934','已发布',0,2,9),(3,'如何传播中国文化','<p>关乎人文，以化成天下&rdquo;，中国传统文化理应与人和社会共同进化。近年来，随着物质生活的提高，人们越来越重视精神文化方面的需求，中国传统文化的传播则有利于满足人们日益增长的精神文化需求。历史悠久的传统节日、丰富多彩的古文诗词乃至极具特色的传统服饰既是中国传统文化传播的重要载体，又是人们必不可少的精神文化食粮。</p>','\\uploads\\03800cf350a76eef90aa3e3c70fd46ca','2023-04-17 18:24:00.591','已发布',1,4,9);
